import React from 'react';

const SideBar = ({ listaConteudo }) => {
  return (
    <div>
      <ul>
        <li>Nosso Conteúdo:</li>
        <li>Por que isso é importante?</li>
        <li>O que aprenderemos?</li>
          <ul>
            {listaConteudo.map(item => <li> {item} </li>)}
          </ul>
        <li>Exercicios:</li>
        <li>Recursos adicionais:</li>
      </ul>
    </div>
  );
};

export default SideBar;
